import React, { useState } from "react";
import axios from "axios";
import "./UserForm.css";  // Asegúrate de tener los estilos adecuados

export default function UserForm() {
  const [userFormData, setUserFormData] = useState({
    nombreUsuario: "",
    correo: "",
    contraseña: "",
    rol: "usuario",  // Puedes hacer esto dinámico o predefinido
    telefono: "",
    avatarUrl: "",
  });
  const [successMessage, setSuccessMessage] = useState("");
  const [errorMessage, setErrorMessage] = useState("");

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setUserFormData({
      ...userFormData,
      [name]: value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post("http://localhost:3000/api/usuarios", userFormData);
      setSuccessMessage("Usuario creado correctamente.");
    } catch (error) {
      setErrorMessage("Error al crear el usuario. Intenta nuevamente.");
      console.error("Error al crear el usuario:", error);
    }
  };

  return (
    <div className="profile-container">
      <form onSubmit={handleSubmit} className="profile-form">
        <h2 className="profile-title">Crear Usuario</h2>

        <div className="form-group">
          <label htmlFor="nombreUsuario">Nombre *</label>
          <input
            type="text"
            id="nombreUsuario"
            name="nombreUsuario"
            className="form-control"
            value={userFormData.nombreUsuario}
            onChange={handleInputChange}
            required
          />
        </div>

        <div className="form-group">
          <label htmlFor="correo">Correo *</label>
          <input
            type="email"
            id="correo"
            name="correo"
            className="form-control"
            value={userFormData.correo}
            onChange={handleInputChange}
            required
          />
        </div>

        <div className="form-group">
          <label htmlFor="contraseña">Contraseña</label>
          <input
            type="password"
            id="contraseña"
            name="contraseña"
            className="form-control"
            value={userFormData.contraseña}
            onChange={handleInputChange}
            required
          />
        </div>

        <div className="form-group">
          <label htmlFor="rol">Rol *</label>
          <select
            id="rol"
            name="rol"
            className="form-control"
            value={userFormData.rol}
            onChange={handleInputChange}
            required
          >
            <option value="usuario">Usuario</option>
            <option value="admin">Administrador</option>
          </select>
        </div>

        <div className="form-group">
          <label htmlFor="telefono">Teléfono</label>
          <input
            type="tel"
            id="telefono"
            name="telefono"
            className="form-control"
            value={userFormData.telefono}
            onChange={handleInputChange}
          />
        </div>

        <div className="form-group">
          <label htmlFor="avatarUrl">URL Avatar *</label>
          <input
            type="url"
            id="avatarUrl"
            name="avatarUrl"
            className="form-control"
            value={userFormData.avatarUrl}
            onChange={handleInputChange}
            required
          />
        </div>

        <button type="submit" className="btn btn-primary mt-3">
          Guardar Usuario
        </button>

        {successMessage && <p className="text-success">{successMessage}</p>}
        {errorMessage && <p className="text-danger">{errorMessage}</p>}
      </form>
    </div>
  );
}
